import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import AddBoxIcon from "@mui/icons-material/AddBox";
import LogoutIcon from "@mui/icons-material/Logout";
import { LoginIcon } from "@mui/icons-material";
import { IconButton, Button } from "@mui/material";

const Header = () => {
  const [userName, setUserName] = useState(null);
  useEffect(() => {
    fetch("http://localhost:4000/profile", { credentials: "include" }).then(
      (response) => {
        response.json().then((userInfo) => {
          setUserName(userInfo.username);
        });
      }
    );
  }, []);
  return (
    <header className="flex justify-between mx-[66px] my-3">
      <Link to="/" className="font-bold text-xl">
        My Blog
      </Link>
      <nav className="space-x-5 font-semibold text-xl">
        {userName && (
          <>
            <Link className="items-center justify-center text-center">
              <div className="flex gap-x-2">
                <Button endIcon={<AddBoxIcon />} variant="outlined">
                  create
                </Button>
                <Button
                  endIcon={<LogoutIcon />}
                  color="error"
                  variant="outlined"
                  className="w-[100px]"
                ></Button>
              </div>
            </Link>
          </>
        )}
        {!userName && (
          <>
            <Link to="/login">Login</Link>
            <Link to="/register">Register</Link>
          </>
        )}
      </nav>
    </header>
  );
};

export default Header;
